import './App.css';

import React, { useEffect, useState } from 'react';

function App() {
  const [message, setMessage] = useState('');

  useEffect(() => {
    fetch('/api/greeting')
      .then(response => response.json())
      .then(data => setMessage(data.greeting));
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to My Simple Website</h1>
        <p>{message}</p>
      </header>
    </div>
  );
}

export default App;
